    var _this = $(this);

    _this.prop('disabled', true);

    _this.html("<span class=\"spinner-border spinner-border-sm\" role=\"status\" aria-hidden=\"true\"></span>\n                        <span class=\"sr-only\">Descargando..</span>");

    var today = new Date();
    var dd = today.getDate();
    var mm = today.getMonth(mm) + 1;
    var yyyy = today.getFullYear();
    var hh = today.getHours();
    var mi = today.getMinutes();
    var ss = today.getSeconds();
    var fecha = yyyy + '' + leadingZero(mm) + '' + leadingZero(dd) + '' + leadingZero(hh) + '' + leadingZero(mi) + '' + leadingZero(ss);
